import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class ProductList extends Component {
  constructor() {
    super();
    this.productCount = 0;
  }

  render() {
    return (
      <div>
        <h1>Header</h1>
        <h1>ProductList</h1>
        <h1>Footer</h1>
      </div>
    );
  }
}

export default ProductList;
